import {Grid, Resume, TechnologyPicture} from './styles';
import Section from '../../components/section';

function AboutMe(){
    return(
        <Section HeaderText="About Me" customstyle="background-color var(--primary);">
            <Grid>
                <Resume>
                    <p># Hi there My name is Oscar Worell Filho ðŸ‘‹</p>
